def decode_pdf(data):
    try: 
        b64_PDF = codecs.encode(codecs.decode(data,'hex'),'base64').decode()
        return(b64_PDF)
    except Exception as e:
        return("""""")


def decode_img(data):
    try:
        b64_IMG = codecs.encode(codecs.decode(data,'hex'),'base64').decode()
        return((b64_IMG))
    except Exception as e:
        return("")

def b64_to_img(base,exp):
	try:
		image = base64.b64decode(base, validate=True)
		file_to_save = exp
		with open(file_to_save, "wb") as f:
			f.write(image)
	except binascii.Error as e:
		print(e)

def b64_to_img_pdf(base,exp):
	try:
		image = base64.b64decode(base, validate=True)
		file_to_save = exp+'.png'
		with open(file_to_save, "wb") as f:
			f.write(image)
	except binascii.Error as e:
		print(e)

def delete_img(exp):
    if os.path.exists(f"{exp}.png"):
        os.remove(f"{exp}.png")
        return('true')
    else:
        return('false')

